    value: On the October Quarterly Report (7/1/06-9/30/06), Schedule A supporting
      Line 15 discloses an offset to an operating expenditure in the amount of $1,131.60.  This
      was paid to the Northstar LPAC by the Coleman for Senate campaign.  However
      LPAC did not incur the original airfare.  Due to this inadvertent administrative
      oversight LPAC is re-paying Coleman for Senate 08 in the amount of $1,131.60
      with this transaction.    The National Association of Broadcasters PAC (NAB)
      received a $5,000 contribution from Mr. Louis Buron.  The NAB indicated on the
      check to the Northstar Leadership PAC that Mr. Louis Buron had earmarked this
      check for the Northstar Leadership PAC.  However, the Northstar Leadership PAC
      did not receive a contribution earmarked for a Federal candidate.
